    render(){
        return(
            <>
            <nav className="courses">
                <img src="" alt="" />
                <h3></h3>

                {/* menu icons */}
                <div className="menu-icons">
                    <i className=''></i>
                </div>

                {/* nav-links for ug pg mba ca */}
                <div>
                    {NavList.map((item,index) => {
                        return(
                            <div key={index} className="main-card" >
                                <div>
                                <img src={item.src} alt=""/>
                                </div>
                                <h2 className=''></h2>
                                <ul>
                                    <li><Link href="">{item.title}</Link></li>
                                </ul>
                            </div>
                        )
                    })}

                </div>
            </nav>

            </>
        )
    }
}

export default NavbarCoureses;
